import { Drawer, Box, Typography, Button, Divider } from '@material-ui/core';
import { Tune as TuneIcon, Close as CloseIcon } from '@material-ui/icons';
import React from 'react';
import FilterStyle from './filter.style';

function FilterDrawer(props) {
    const styles = FilterStyle();

    return (
        <Drawer
            anchor="right"
            open={props.open}
            onClose={props.handleClose}>
            <Box className={styles.body}>
                <Box className={styles.head}>
                    <Box className={styles.head}>
                        <TuneIcon className={styles.grayIcon} />
                        <Typography className={styles.darkGrayText}>
                            FILTROS
                        </Typography>
                    </Box>
                    <Button
                        className={styles.headButton}
                        variant='contained'
                        onClick={props.handleClose}>
                        <CloseIcon className={styles.grayButtonIcon} />
                    </Button>
                </Box>
                <Typography className={styles.grayText}>
                    Utilize os filtros abaixo para refinar os resultados da tabela, clique no botão APLICAR para salvar as alterações.
                </Typography>
                <Divider className={styles.divider} />
                <KeyboardDatePicker
                    disableToolbar
                    variant="inline"
                    format="MM/dd/yyyy"
                    margin="normal"
                    id="date-picker-inline"
                    label="Date picker inline"
                    value={selectedDate}
                    onChange={handleDateChange}
                    KeyboardButtonProps={{
                        'aria-label': 'change date',
                    }}
                />
                <KeyboardDatePicker
                    disableToolbar
                    variant="inline"
                    format="MM/dd/yyyy"
                    margin="normal"
                    id="date-picker-inline"
                    label="Date picker inline"
                    value={selectedDate}
                    onChange={handleDateChange}
                    KeyboardButtonProps={{
                        'aria-label': 'change date',
                    }}
                />
                <Button
                    className={styles.headButton}
                    variant='contained'
                    onClick={props.handleClose}>
                        APLICAR
                </Button>
            </Box>
        </Drawer>
    );
}

export default FilterDrawer;
